import ReactDOM from 'react-dom';
import Card from './Card';
import './index.css';
import Sdata from './Sdata';
ReactDOM.render(
  <>
    <h1 className='heading'>TVF Best Web Series</h1>

    <Card
      simg={Sdata[0].simg}
      sname={Sdata[0].sname}
      stitle={Sdata[0].stitle}
      slink={Sdata[0].slink}
    />
    <Card
      simg={Sdata[1].simg}
      sname={Sdata[1].sname}
      stitle={Sdata[1].stitle}
      slink={Sdata[1].slink}
    />
