      slink={Sdata[0].slink}
    />
    <Card
      simg={Sdata[0].simg}
      sname={Sdata[0].sname}
      stitle={Sdata[0].stitle}
      slink={Sdata[0].slink}
    />
  </>,
  document.getElementById('root')
);
